    }

    render() {
        return (
            <form className='form' onSubmit={this.storeData}>
                <div className='inpDiv'>
                    <label htmlFor='userName' >Username/Email :</label><br></br>
                    <input 
                           id='userName' 
                           className='userInp' 
                           type={text}
                           name='userName'
                           placeholder='Enter your name here:'
                           userName={this.state.userName}
                           required 
                    />
                </div>
                <div className='inpDiv'>
                    <label htmlFor='userPassword'>Password :</label><br></br>
                    <input 
                           id='userPassword' 
                           className='userInp' 
                           type={text} 
                           name='userPassword' 
                           placeholder='Enter your password here:' 
                           userPassword={this.state.userPassword}
                           required 
                    />
                </div>
                <button>Submit!</button>
            </form>
        )
    };
};

export default Login;
